INSERT INTO `sys_oper_log` VALUES (95, '书籍', 1, 'com.ldb.project.server.controller.BookController.add()', 'POST', 1, 'admin', '研发部门', '/server/Book', '127.0.0.1', '内网IP', '{\"author\":\"洗头佬\",\"bookName\":\"我的奋斗\",\"bookPrice\":500000,\"bookType\":\"文学\",\"bookshelfNumber\":\"1\",\"borrowedNumber\":\"0\",\"collectionNumber\":50,\"inLibrariesNumber\":\"50\",\"params\":{},\"publishingHouse\":\"慕尼黑啤酒馆\",\"summary\":\"《我的奋斗》（德语：Mein Kampf）是德国元首兼纳粹党党魁阿道夫·希特勒于1925年出版的一部自传，融合了其政治意识形态，在当时的德国引起了巨大反响，并成为日后德国纳粹党的思想纲领。这本书有“世界上最危险的书”之称。本书讲述了希特勒的生活经历及其世界观，最核心的思想为宣扬德国与奥地利合并及反犹太主义。在纳粹德国战败后，此书因宣扬纳粹主义思想而在不少国家的出版发行受到法律的约束。作为希特勒生前出版的唯一一本书，《我的奋斗》在世界范围内都相当著名，其续篇《第二本书》则是在第二次世界大战之后出版的。\"}', NULL, 1, '\r\n### Error updating database.  Cause: java.sql.SQLException: Field \'book_id\' doesn\'t have a default value\r\n### The error may exist in file [D:\\Workshop\\Codes\\FIGHT\\LibraryDBMS\\target\\classes\\mybatis\\server\\BookMapper.xml]\r\n### The error may involve com.ldb.project.server.mapper.BookMapper.insertBook-Inline\r\n### The error occurred while setting parameters\r\n### SQL: insert into book          ( book_name,             author,             book_type,             book_price,             publishing_house,             summary,             bookshelf_number,             collection_number,             borrowed_number,             in_libraries_number )           values ( ?,             ?,             ?,             ?,             ?,             ?,             ?,             ?,             ?,             ? )\r\n### Cause: java.sql.SQLException: Field \'book_id\' doesn\'t have a default value\n; Field \'book_id\' doesn\'t have a default value; nested exception is java.sql.SQLException: Field \'book_id\' doesn\'t have a default value', '2023-12-09 20:09:15', 285);
